const SpreadSpin = (
  number: number,
  spX: number,
  spY: number,
  endX: number,
  endY: number,
  rotZ: number,
  rotGap: number
) => keyframes`
    0% {
      transform: rotateZ(${number * rotGap}deg) translate(0px, 0px);
    }
    30% {
      transform: rotateZ(${
        number * rotGap
      }deg) translate(${spX}px, ${spY}px) scale(1.1);
    }
    70% {
      transform: rotateZ(${
        number * rotGap + rotZ
      }deg) translate(${spX}px, ${spY}px) scale(1.1);
    }
    100% {
      transform: rotateZ(${
        number * rotGap + rotZ
      }deg) translate(${endX}px, ${endY}px);
    }
`;

